  JWILLIAMS, Anthony Philip Marsh and SPENCER, Pamela Helen
  WILLIAMS, Anthony Philip Marsh and SPENCER, Pamela Helen (cont...)
  member of various Rotary district committees. His sports and interests included tennis, skiing, scuba
  diving, boating and keeping fit. He was a sidesman at St Mark's Church.
  02> WILLIAMS, Leslie Elizabeth Esme m on 11.04.1956 to HARVISON, Robert Ernest
  b 01.03.1932
  b 23.05.1931
  Leslie b. at Auckland and m. at St Mark's Church, Remuera, Auckland, Robert, s/o William Ernest
  Harvison and Florence Amelia Humphries, b. at Auckland. Address: "Waikoa", Mangatangi Road, RD 1,
  Pokeno.
  Leslie was educated at Marsden School, Wellington, and St Cuthbert's College, Auckland then went on to
  Auckland University. She was a potter for 20 years, until moving to Mangatangi, and now enjoys
  gardening and golf.
  Robert was educated at King's School and King's College, Auckland, then studied accountancy at Auckland
  University. He spent ten years with the 3rd Auckland Regiment as a Territorial, retiring as Captain.
  He expanded his family printing business, retiring after 35 years as managing director. He and Leslie
  then moved to Mangatangi to take up farming. Leslie is also involved in the local golf club.
  01> HARVISON, Linda Christine m on 23.02.1985 to DARWIN, Bruce William
  b 08.06.1957
  b 20.08.1960
  Linda b. and m, at Auckland. Bruce, s/o Dr John Haddrick Darwin (Govt statistician) and Helen
  Gabites (music teacher), b. at Christchurch. Address: 8 Minto Road, Remuera, Auckland.
  Linda was educated at Whenuapai Primary School, Remuera Primary School and St Cuthbert's College
  (1969-73). She trained as a receptionist, secretary/personal assistant and worked for various
  companies in Auckland and in Sydney. She travelled widely in the United Kingdom and Europe in 1980
  and in 1988. Linda has had epilepsy since birth but after highly successful brain surgery in 1992
  she has been able to drive for the first time and her lifestyle has changed significantly. Her
  interests include handcrafts, sewing, gardening and power-walking.
  Brian is an accountant and investment financier. He plays competitive tennis and enjoys other
  sports and genealogy.
  01> DARWIN, Helen Elizabeth
  b 22.05.1990
  Helen attends St Cuthbert's College, Auckland.
  02> DARWIN, Claire Louise
  b 30.09.1994
  02> HARVISON, Jane Louise m on 14.03.1987 to REDDING, Keith James
  b 26.05.1959
  b 18.02.1959
  Address: 28 Maungakiekie Avenue, Greenlane, Auckland.
  Jane and Keith met during the early 80s at Auckland University where they were both studying for a
  Bachelor of Commerce. Following graduation they worked for three years before travelling overseas
  together. They worked in the United Kingdom and South Africa as chartered accountants. After
  extensive overseas travel over a period of four years, they returned to New Zealand to raise a
  family.
  Keith is presently employed in the corporate finance division of a major bank in New Zealand whilst
  Jane is employed as an accountant on a part-time basis.
  01> REDDING, Amy Louise
  b 11.01.1990
  Amy b. at Auckland.
